     QScriptValue REcmaArcData::copy
    (QScriptContext *context, QScriptEngine *engine)
    
    {
        RArcData cp = qscriptvalue_cast<RArcData>(context->thisObject());
        return qScriptValueFromValue(engine, cp);
    }
     QScriptValue REcmaArcData::destroy(QScriptContext *context, QScriptEngine *engine)
    
    {

        RArcData* self = getSelf("RArcData", context);
        //Q_ASSERT(self!=NULL);
        if (self==NULL) {
            return REcmaHelper::throwError("self is NULL", context);
        }
        
    
        delete self;
        context->thisObject().setData(engine->nullValue());
        context->thisObject().prototype().setData(engine->nullValue());
        context->thisObject().setPrototype(engine->nullValue());
        context->thisObject().setScriptClass(NULL);
        return engine->undefinedValue();
    }
    RArcData* REcmaArcData::getSelf(const QString& fName, QScriptContext* context)
    
        {
            RArcData* self = NULL;

            
                // self could be a normal object (e.g. from an UI file) or
                // an ECMA shell object (made from an ECMA script):
                //self = getSelfShell(fName, context);
                

            //if (self==NULL) {
                self = REcmaHelper::scriptValueTo<RArcData >(context->thisObject())
                
                ;
            //}

            if (self == NULL){
                // avoid recursion (toString is used by the backtrace):
                if (fName!="toString") {
                    REcmaHelper::throwError(QString("RArcData.%1(): "
                        "This object is not a RArcData").arg(fName),
                        context);
                }
                return NULL;
            }

            return self;
        }
